import React from "react";
import { Spring } from "react-spring";

export default function Box1() {
  return (
    <>
      <Spring>{props=>(<div style={props}></div>)}</Spring>
      
    </>
  );
}

const style = {
  background: "steelblue",
  color: "white",
  padding: "1.5rem",
};
